import React from "react"
import {Route , Switch , NavLink  } from 'react-router-dom';
import './index.css'


const Menu =()=>{

return(<> 

<NavLink exact activeClassName = 'about' to='/'>AboutUS</NavLink>

<NavLink exact activeClassName = 'contact' to='/Contact'>ContactUS</NavLink>
<NavLink exact activeClassName = 'Error' to='/Service'>ContactUS</NavLink>
</>);





}
export default Menu;
